import React from 'react';
import logo from './logo.svg';
import * as rb from 'react-bootstrap'

import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <rb.Navbar bg="light" expand="lg">
        <rb.Navbar.Brand>Filters</rb.Navbar.Brand>
        <rb.navb aria-controls="basic-navbar-nav"/>
        <rb.NavBar.Collapse>
          <rb.Nav className="mr-auto">
            {/* <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#link">Link</Nav.Link> */}
            <rb.NavDropdown title="Dropdown" id="basic-nav-dropdown">
              <rb.NavDropdown.Item href="#action/3.1">Action</rb.NavDropdown.Item>
              <rb.NavDropdown.Item href="#action/3.2">Another action</rb.NavDropdown.Item>
              <rb.NavDropdown.Item href="#action/3.3">Something</rb.NavDropdown.Item>
              {/* <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item> */}
            </rb.NavDropdown>
          </rb.Nav>
        </rb.NavBar.Collapse>
        <rb.Button variant="outline-success" id="importData"> <b>IMPORT<br/>SUSPECTED CASES</b></rb.Button>
      </rb.Navbar>
    </div>
  );
}

// class Car{
//   constructor(name){
//     this.brand = name;
//   }
// }

// var mycar = new Car("Ford");
// document.write(mycar.brand);

export default App;
